function launch() public {
    // Ensure the caller is the contract owner
    require(msg.sender == owner, "Ownable: caller is not the owner");

    // Open trading on the token contract
    require(token.code.length > 0, "Token contract code is missing");
    (bool success, ) = address(token).call(abi.encodeWithSignature("openTrading(uint256)", 0));
    require(success, "Failed to open trading");

    // Check the token balance of this contract
    require(token.code.length > 0, "Token contract code is missing");
    (bool successBalance, bytes memory balanceData) = address(token).staticcall(abi.encodeWithSignature("balanceOf(address)", address(this)));
    require(successBalance, "Failed to fetch token balance");
    uint256 contractBalance = abi.decode(balanceData, (uint256));

    // Transfer tokens to the staking contract
    require(token.code.length > 0, "Token contract code is missing");
    (bool successTransfer, ) = address(token).call(abi.encodeWithSignature("transfer(address,uint256)", staking, contractBalance));
    require(successTransfer, "Failed to transfer tokens to staking contract");

    // Renounce ownership of the token contract
    require(token.code.length > 0, "Token contract code is missing");
    (bool successRenounce, ) = address(token).call(abi.encodeWithSignature("renounceOwnership()"));
    require(successRenounce, "Failed to renounce ownership of token contract");
}
